LuaFunction.Formula:
function NOBN_VerticalProfileElevationFormatting(x, d)
	return string.format("H=%.0"..d.."f".." m.o.h.", x)
end

function NOBN_VerticalProfileMileageFormatting(x, d)
	return string.format("PEL.%.0"..d.."f", x)
end

function NOBN_MileageAnnotationsMileageFormatting(a, x, d)
	return string.format("Km.%.0"..d.."f", x)
end

function NOBN_com_Pset_BaneNORBaneDataID()
	--Expected RcType format: 'JBTff_ttt ObjectTypeName'
	a,b = RcType:upper():match("^JBT(%a%a)_(%a%a%a)")
	if a and b then 
		return string.format("%s-%s-%06d",a:upper(),b:upper(),0)
	else
		return _warning, "Ukjent", 
			_info("[Grunnleggende].[RC Type] (RcType) har ikke forventet format 'JBTff_ttt-dddddd <objekttypenavn>' - slett denne formelen og skriv inn Objekt-ID manuelt på korrekt format.")
	end
end

function NOBN_com_Pset_BaneNORByggesFase()
	XXxx = tostring(Stage):match("^.*(%d%d%d%d)%-%d%d%d%d.*")
	if XXxx == nil then 
		return _warning, 'Ukjent',
			_info("WARNING - Ugyldig fasekode i [Generelt].[Fasekode XXxx-YYyy] (Stage), kan ikke avgjøre når objektet bygges.")
	else
		return string.format("%02d.%02d",XXxx//100,XXxx%100)
	end
end

function NOBN_com_FDVBaneDataBeskrivelse()
	return BaneNORBeskrivelse, _info("Verdi er hentet fra [Pset Bane NOR].Beskrivelse")
end

function NOBN_com_Pset_FDVBaneDataSportypeFra() if RcAlignment and RcType == "JBTKO_SPO Spor" then --Linjeobjekt av type jernbanespor: --(Use getPropertyValue() to avoid an endless loop, since also tracks will be assigned this formula) return getPropertyValue("FDVBaneDataSporTypeFra")
elseif Alignment and Alignment.RcType == "JBTKO_SPO Spor" then --Punktobjekt i jernbanespor: return Alignment.FDVBaneDataSporTypeFra
else --Ingen direkte angivelse av sportilhørighet: if RcAlignment then --Linjetype av annen type enn jernbanespor: x = RcAlignment.StartPoint.X y = RcAlignment.StartPoint.Y else --Punktobjekt i annen linjetype enn jernbanespor: x = geoCoord.X y = geoCoord.Y end t = getClosestTracks(x,y) n = getCollectionLength(t) --Exploit the fact that closest tracks are sorted by proximity: for i = 0,n-1 do ai = getAlignmentInfo(t[i].id,x,y) if ai.NormalProjectionExists then return t[i].FDVBaneDataSporTypeFra end end --Fant ingen spor vi kunne projisere oss inn på: if RcAlignment then return _warning, "Ukjent", _info("Linjens startpunkt har ikke en projeksjon på noen av sporene i modellen, kan ikke utlede tilhørende spors anvendelsestype.") else return _warning, "Ukjent", _info("Punktobjektet har ikke en projeksjon på noen av sporene i modellen, kan ikke utlede tilhørende spors anvendelsestype.") end end end

function NOBN_com_Pset_FDVBaneDataSporNrFra() if RcAlignment and RcType == "JBTKO_SPO Spor" then --Linjeobjekt av type jernbanespor: return RC__identify(this)
elseif Alignment and Alignment.RcType == "JBTKO_SPO Spor" then --Punktobjekt i jernbanespor: return RC__identify(Alignment)
else --Ingen direkte angivelse av sportilhørighet: if RcAlignment then --Linjetype av annen type enn jernbanespor: x = RcAlignment.StartPoint.X y = RcAlignment.StartPoint.Y else --Punktobjekt i annen linjetype enn jernbanespor: x = geoCoord.X y = geoCoord.Y end t = getClosestTracks(x,y) n = getCollectionLength(t) --Exploit the fact that closest tracks are sorted by proximity: for i = 0,n-1 do ai = getAlignmentInfo(t[i].id,x,y) if ai.NormalProjectionExists then return RC__identify(t[i]) end end --Fant ingen spor vi kunne projisere oss inn på: if RcAlignment then return _warning, "Linjens startpunkt har ikke en projeksjon på noen av sporene i modellen, kan ikke utlede sportilhørighet." else return _warning, "Punktobjektet har ikke en projeksjon på noen av sporene i modellen, kan ikke utlede sportilhørighet." end end end

function NOBN_com_Pset_FDVBaneDataAvstSpormidtFra() if RcAlignment and RcType == "JBTKO_SPO Spor" then --Linjeobjekt av type jernbanespor: return string.format("%.03f",0.000), _info("Null avstand til seg selv, spor "..RC__identify(this))
elseif Alignment and Alignment.RcType == "JBTKO_SPO Spor" then --Punktobjekt i jernbanespor: return string.format("%.03f",RC__round(DistanceToAlignment)), _info("Avstand til spor "..RC__identify(Alignment))
else --Ingen direkte angivelse av sportilhørighet: if RcAlignment then --Linjetype av annen type enn jernbanespor: x = RcAlignment.StartPoint.X y = RcAlignment.StartPoint.Y else --Punktobjekt tilhørende en annen linjetype enn jernbanespor: x = geoCoord.X y = geoCoord.Y end t = getClosestTracks(x,y) n = getCollectionLength(t) --Exploit the fact that closest tracks are sorted by proximity: for i = 0,n-1 do ai = getAlignmentInfo(t[i].id,x,y) if ai.NormalProjectionExists then return string.format("%.03f",RC__round(ai.DistanceToAlignment)), _info("Avstand til spor "..RC__identify(t[i])) end end --Fant ingen spor vi kunne projisere oss inn på: if RcAlignment then return _warning, 0, _info("Linjens startpunkt har ikke en projeksjon på noen av sporene i modellen, kan ikke utlede avstand sideveis til noe spor.") else return _warning, 0, _info("Punktobjektet har ikke en projeksjon på noen av sporene i modellen, kan ikke utlede avstand sideveis til noe spor.") end end end

function NOBN_com_FDVBaneDataNordFra()
	if RcAlignment then
		--Alignment object:
		return RC__round(RcAlignment.StartPoint.Y,3), _info("Nord (Y) i kartprojeksjon "..DocumentData.CoordinateSystem)
	else
		--Point object:
		return string.format("%.3f",geoCoord.Y), _info("Nord (Y) i kartprojeksjon "..DocumentData.CoordinateSystem)
	end
end

function NOBN_com_FDVBaneDataOestFra()
	if RcAlignment then
		--Alignment object:
		return RC__round(RcAlignment.StartPoint.X,3), _info("Øst (X) i kartprojeksjon "..DocumentData.CoordinateSystem)
	else
		--Point object:
		return string.format("%.3f",geoCoord.X), _info("Øst (X) i kartprojeksjon "..DocumentData.CoordinateSystem)
	end
end

function NOBN_com_FDVBaneDataHoeydeFra()
	if RcAlignment then
		--Alignment object:
		return RC__round(RcAlignment.StartPoint.Z,3), _info("Høyde over midlere havnivå (Z) i vertikalt datum "..DocumentData.CoordinateSystem)
	else
		--Point object:
		return string.format("%.3f",geoCoord.Z), _info("Høyde over midlere havnivå (Z) i vertikalt datum "..DocumentData.CoordinateSystem)
	end
end
